import './App.css';
import RegisterPage from './Pages/register';
import {Routes, Route} from 'react-router';
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return <Routes>
    <Route path='/registration' element={RegisterPage} />

  </Routes>
}

const Root = () => (
  <Router>
    <App/>
  </Router>
)

export default Root;
